INSERT INTO `job_titles` VALUES (1,'Director of Operations','This position is appointed by the Gibson County Council.  The Director of Operations will oversee the day to day operations of Gibson County Ambulance Service.  The director will answer to the Council and Commisioners at least once a month.  blah blah blah','Salary','per Month','Full Time','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL),(2,'Full Time Advanced EMT','The full time advanced EMT will be responsible for evaluating, treating, and transporting sick and injured patients to the appropriate medical facility.  The full time AEMT shall be responsible for completing all local, state, and federal paper work required to document any treatment administered or withheld from a patient while in the AEMT\'s care.','Hourly','per Hour','Full Time','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL),(3,'Full Time EMT','The full time EMT will be responsible for evaluating, treating, and transporting sick and injured patients to the appropriate medical facility.  The full time shall be responsible for completing all local, state, and federal paper work required to document any treatment administered or withheld from a patient while in the EMT\'s care.','Hourly','per Hour','Full Time','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL),(4,'Full Time Paramedic','The full time paramedic will be responsible for evaluating, treating, and transporting sick and injured patients to the appropriate medical facility.  The full time paramedic will work a 24 hour shift based on the Kelly Work Schedule.  The full time paramedic shall be responsible for completing all local, state, and federal paper work required to document any treatment administered or withheld from a patient while in the paramedic\'s care.','Hourly','per Hour','Full Time','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL),(5,'Medical Director','Oversee and monitor all medical aspects of Gibson County Ambulance Service.  Review and approve treatment protocols. So on and So forth','Contract','per Month','Other','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL),(6,'Office Manager','Manage office and billing and so forth','Salary','per Month','Full Time','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL),(7,'Part Time Advanced EMT','The part-time AEMT will be responsible for evaluating, treating, and transporting sick and injured patients to the appropriate medical facility.  The part-time AEMT shall be responsible for completing all local, state, and federal paper work required to document any treatment administered or withheld from a patient while in the AEMT\'s care.\n\nThe Part-Time AEMT has no guarantee of the number of hours available to work in any given time frame.','Hourly','per Hour','Part Time','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL),(8,'Part Time Driver','To drive and assist as needed.','Hourly','per Hour','Part Time','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL),(9,'Part Time EMT','The part-time EMT will be responsible for evaluating, treating, and transporting sick and injured patients to the appropriate medical facility.  The part-time EMT shall be responsible for completing all local, state, and federal paper work required to document any treatment administered or withheld from a patient while in the EMT\'s care.\n\nThe Part-Time EMT has no guarantee of the number of hours available to work in any given time frame.','Hourly','per Hour','Part Time','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL),(10,'Part Time Paramedic','The part-time paramedic will be responsible for evaluating, treating, and transporting sick and injured patients to the appropriate medical facility.  The part-time paramedic shall be responsible for completing all local, state, and federal paper work required to document any treatment administered or withheld from a patient while in the paramedic\'s care.\n\nThe Part-Time paramedic has no guarantee of the number of hours available to work in any given time frame.','Hourly','per Hour','Part Time','2017-12-18 18:46:50',NULL,'2017-12-18 18:46:50',NULL);
